import React from 'react';

export function Header() {
  return (
    <header className="header">
      <div className="header-wrap">
        <div className="logo">
          <div className="logo-mark" />
          URL Shortener
        </div>
        <nav className="nav">
          <a href="#features">Features</a>
          <a href="#how">How it works</a>
          <a href="#about">About</a>
        </nav>
      </div>
    </header>
  );
}
